import React from "react";

const Persons = ({ NamesToShow }) => (
  <div>
    <h2>Numbers</h2>
    <div>
      {NamesToShow.map((country) => (
        <h4 key={country.name + Math.random() * 123}>{country.name}</h4>
      ))}
    </div>
  </div>
);

export default Persons;
